import { StyleSheet, Text, View } from 'react-native'
import React from 'react'
import Video from './Video'
export default function Videos({videos}) {
    console.log(videos)
  return (
    <View>
      {videos.map((item,idx)=>(        
        <View key={idx}>
          <Video video={item}/>
        </View>
        ))}

    </View>
  )
}

const styles = StyleSheet.create({
    image:{
        height:280,
        width:"100%"  
      }
})
